/** @format */
import React from "react";
import "../components/main.css";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import ResponsiveEmbed from "react-bootstrap/ResponsiveEmbed";
import hvr from "hover.css";
import Container from "react-bootstrap/Container";



const Videos=({ posts, loading })=> {
if(loading){
return <h6 className="text-center mb-10">Loading... !!</h6>

}

  return (
    <div>
      <h2>Welcome to Videos Page</h2>
   {posts && posts.map(post=>(
   <Container fluid={true}>
     
     <Col xl={4} lg={4} md={6} sm={12} xs={12} >
       <div className="text-center">
         <ResponsiveEmbed
           aspectRatio="16by9"
           className="iframcustom hvr-grow"
         >
           <embed src={post.VideoLink} />
         </ResponsiveEmbed>
         <h6 className="videotitlestyle">{post.VideoTitle}</h6>
         <p className="videotextstyle"> {post.VideoSummary}</p>
       </div>
     </Col>
     
 </Container>

    )) }

    </div>
  );
  
}

export default Videos;
